?><p align="justify"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;"><span style="color: black;">История этой знаменитой компании, которая производила часовые механизмы, началась в 1871 году. В этом году, знаменитый изобретатель вместе с сыном часовщика Карлом Бамбергом наладили производство приборов, ориентированных на морской флот. К 1940-м годам нельзя было увидеть самолет, на борту которого не было приборов </span><span style="color: black;">Askania</span><span style="color: black;">. В течение нескольких лет пилоты начали носить наручные часы этой фирмы, которые отличались великолепными качествами. Сегодня </span><span style="color: black;">Askania </span><span style="color: black;">создает часы высочайшего качества с не менее высокой точностью. Около 140 лет компания чтит традиции изготовления чрезвычайно точных инструментов. Приобретя часы </span><span style="color: black;">Askania</span><span style="color: black;">, Вы получите изысканный дизайн и, выше всяких похвал, качество. </span></span></span>
